import React from 'react';

function Content() {
  return (
    <main className="Content">
      <div className="TopPanel">
        <ul>
          <li>Introduction</li>
          <li>Resume</li>
          <li>Projects</li>
          <li>References</li>
          <li>Contact</li>
          {/* Add other menu items here */}
        </ul>
      </div>
      <div className="MainContent">
        {/* Add main content here */}
      </div>
    </main>
  );
}

export default Content;
